import React, { Component } from "react";

class PRODUCTOS extends Component {
  render() {
    const { productos } = this.props;
    return (
      <div>
        <ul className="ul">
          {productos.map((el) => (
            <li key={el.name}>
              <img className='img__li' alt={el.name} src={el.img}></img>
            </li>
          ))}
        </ul>
      </div>
    );
  }
}

export default PRODUCTOS;
